import PropTypes from 'prop-types';

const CardCourse = ({ course }) => (
  <>
    <div>
      <img className="w-9/12" src={course.image} alt="" />
    </div>
    <div>
      <h4>{course.teacher}</h4>
    </div>
  </>
);

CardCourse.propTypes = {
  course: PropTypes.string.isRequired,
};

export default CardCourse;
